import React from 'react';
import { Link }  from 'react-router-dom';
const Track = (props) => {
    const { track } = props;

    return (
        <div className="col-md-6">
            <div className="card mb-4 shadow-sm">
                <div className ="card-body">
                    <p className="card-text">

                        <strong><i className="far fa-play-circle"> Track</i></strong>: {track}</p> 
                        <p><i className="fas fa-compact-disc"/> <strong>Artist:</strong>  <h6>{props.artist}</h6>

                    </p>

                    <img src={props.cover} width='150'></img>
                    <p></p>
                    <p><strong>Album:</strong> {props.album}</p>
                   <Link to={`lyrics/track/${props.id_track}`}
                   className=""> View Lyrics</Link>
                </div>
            </div>

        </div>
    )
}
export default Track;
